import React from "react";
import PhoneList from "./PhoneList";

const PhoneDashboardPage = () => (
  <div className="background">
    <PhoneList />
    <style jsx>
      {`
        .background {
          background: linear-gradient(to right, #5834db, #e60073);
        }
      `}
    </style>
  </div>
);

export default PhoneDashboardPage;
